import React from "react"
import "./Header.css"

const Header = () => {
  return (
    <div className='header'>
      <span className="title">Word Hunt</span>
      <div className="inputs">
      <TextField id="standard-basic" label="Standar" variant="outlined" />
      </div>
    </div>
  )
}

export default Header
